import base64
import struct
import matplotlib.pyplot as plt

# ==============================
# ðŸ”§ PASTE YOUR DATA HERE
# ==============================

curvespoints_b64 = ""
curvesnumpoints_b64 = ""

# ==============================
# ðŸ§  Decode binary
# ==============================

points_raw = base64.b64decode(curvespoints_b64)
counts_raw = base64.b64decode(curvesnumpoints_b64)

# Float32 little-endian
floats = struct.unpack("<" + "f" * (len(points_raw)//4), points_raw)

# UInt32 little-endian
counts = struct.unpack("<" + "I" * (len(counts_raw)//4), counts_raw)

print("Total floats:", len(floats))
print("Total strokes:", len(counts))

# ==============================
# ðŸ”¢ Convert to (x, y) pairs
# ==============================

points = list(zip(floats[0::2], floats[1::2]))

print("Total points:", len(points))
print("First few points:", points[:5])

# ==============================
# ðŸ“ Compute bounds (important!)
# ==============================

xs_all = [p[0] for p in points]
ys_all = [p[1] for p in points]

print("X range:", min(xs_all), max(xs_all))
print("Y range:", min(ys_all), max(ys_all))

# ==============================
# ðŸŽ¨ Plot strokes correctly
# ==============================

plt.figure(figsize=(10, 10))

index = 0

for c in counts:
    stroke = points[index:index + c]
    index += c

    if len(stroke) < 2:
        continue

    xs = [p[0] for p in stroke]
    ys = [p[1] for p in stroke]

    plt.plot(xs, ys, linewidth=1, color="black")

# iOS coordinate system fix
plt.gca().invert_yaxis()
plt.axis("equal")
plt.title("Notability Stroke Reconstruction")

plt.show()